    @Test
    public void parse() throws Exception {
        Store store = ParseUtil.parseStore(response);
        assert (store.getApps().size() == 20);
        assert (store.getCategories().size() == 11);
        assert (store.getAppsByCategoryOrderByLabel(6014).size() == 5);
        assert (store.getAppsByCategoryOrderByLabel(60).size() == 0);
        assert (store.getAppsByCategoryOrderByLabel(6007).size() == 1);
    }

